import React from "react";
import { Formik } from "formik";
import * as yup from "yup";

const AddPage = () => {
  const initialValues = {
    userId: "",
    category: "",
    no_of_bathrooms: "",
    food_categories: "",
    image_path: "",
    description: "",
    area: "",
    city: "",
    state: "",
    reviews: "",
  };
  return (
    <>
      <div className="filterhandles">
        <div className="headText">Create Your Own Advertisement</div>
      </div>
      <div></div>
    </>
  );
};

export default AddPage;
